namespace Leetcode1007;


public class Solution
{
    private int GetFlips(int candidate, int[] keepList, int[] flipList)
    {
        int flips = 0;
        for (int i = 1; i < keepList.Length; i++)
        {
            if (candidate == keepList[i])
            {
                // do nothing
            }
            else if (candidate == flipList[i])
            {
                flips++;
            }
            else
            {
                return 100000;
            }
        }

        return flips;
    }

    public int MinDominoRotations(int[] tops, int[] bottoms)
    {
        int topFlip1 = GetFlips(tops[0], tops, bottoms);
        int topFlip2 = GetFlips(bottoms[0], tops, bottoms) + 1;
        int bottomFlip1 = GetFlips(bottoms[0], bottoms, tops);
        int bottomFlip2 = GetFlips(tops[0], bottoms, tops) + 1;
        int ans = new int[] { topFlip1, topFlip2, bottomFlip1, bottomFlip2 }.Min();
        if (ans >= 100000)
        {
            return -1;
        }
        return ans;
    }
}

